const dashcontainerStyle = theme => ({
    container: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "column",
        justifyContent: "flex-start",
        width: "100%"
    },
    accordion: {
        width: "90%"
    },
    typo: {
        height: "fit-content",
        width: "inherit",
        padding: "2rem",
    },
    column: {
        flexBasis: "33.3%",
        display: "flex",
        justifyContent: "space-evenly",
    },
    secondaryHeading: {
        color: theme.palette.text.secondary,
    },
})

export default dashcontainerStyle;
